import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

export const Done = () => {

  const [projectName, setProjectName] = useState('');

  useEffect(() => {
    const currentURL = new URL(window.location.href);
    const searchParams = currentURL.searchParams;
    setProjectName(searchParams.get('projectname'))
  }, []);

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-200">
      <p className="text-[24px] text-center leading-loose">
        {projectName} 프로젝트에 대한 배포 신청이 완료되었습니다!<br/>
        배포 Action 사용을 위한 엑세스 키 및 DB 계정 정보는 이메일을 통해 전송됩니다.<br/>
        프로젝트에 대한 배포를 더 요청하고 싶다면 아래 버튼을 눌러주세요.
      </p>

      <a href="/survey">

      </a>
      <button
          className="w-[120px] px-4 py-2 mt-6 font-bold text-white bg-blue-500 rounded-md hover:bg-blue-700 focus:outline-none focus:shadow-outline"
          type="button" 
      >
          돌아가기
      </button>
    </div>
  );
}
